// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;

pragma abicoder v2;

// import ERC721 iterface
import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";
import "@openzeppelin/contracts/utils/Context.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

// HyperXNFTCollection smart contract inherits ERC721 interface
contract HyperXNFTCollection is ERC721, ReentrancyGuard, Ownable {

    event MintNewToken(address minter, string _name, string _tokenURI, uint256 numOfCopy, uint256 _price, uint256 payment);
    event ChangedPrice(address owner, uint256 tokenId, uint256 oldPrice, uint256 newPrice);
    event BuyToken(address buyer, uint256 tokenId);
    event ToggleOnSale(address owner, uint256 tokenId, bool onSale);

    // total number of HyperXNFT minted
    uint256 private tokenCounter;

    // define enum for payment typeof
    enum HyperXPaymentType {
        HyperXToken,
        BNB,
        BUSD
    }

    // define struct
    struct HyperXUnit {
        uint256 tokenId;
        string tokenName;
        string tokenURI;
        address mintedBy;
        address previousOwner;
        uint256 price;
        HyperXPaymentType payout;
        uint256 numberOfTransfers;
        bool forSale;

        string title;
        string category;
        string description;
        string hashtags;
    }

    // map token id to struct
    mapping(uint256 => HyperXUnit) private allNFTUnits;

    // check if token name exists
    mapping(string => bool) private tokenNameExists;
    // check if token URI exists
    mapping(string => bool) private tokenURIExists;

    // initialize contract while deployment with contract's collection name and token
    constructor(string memory collectionName, string memory symbolName)
        ERC721(collectionName, symbolName)
    {
        tokenCounter = 0;
    }

    function convertPaymentString(uint256 payment)
        internal
        pure
        returns (HyperXPaymentType)
    {
        if (payment == 0) return HyperXPaymentType.HyperXToken;
        else if (payment == 1) return HyperXPaymentType.BNB;
        else if (payment == 2) return HyperXPaymentType.BUSD;
        else return HyperXPaymentType.HyperXToken;
    }

    // mint a new token
    function mintNewNFT(
        string memory _name,
        string memory _tokenURI,
        uint256 numOfCopy,
        uint256 _price,
        uint256 payment,
        string memory title,
        string memory category,
        string memory description,
        string memory hashtags
    ) external nonReentrant onlyOwner {
        // check if thic fucntion caller is not an zero address account
        require(_msgSender() != address(0), "minter is null");

        // check if the token URI already exists or not
        require(!tokenURIExists[_tokenURI], "URI repetition while minting");
        // check if the token name already exists or not
        require(!tokenNameExists[_name], "name repetition while minting");

        for (uint256 i = 0; i < numOfCopy; i++) {
            // check if a token exists with the above token id => incremented counter
            require(!_exists(tokenCounter), "token id repetition while minting");

            // mint the token
            _mint(_msgSender(), tokenCounter);

            // creat a new token info (struct) and pass in new values
            HyperXUnit memory newToken = HyperXUnit(
                tokenCounter,
                _name,
                _tokenURI,
                _msgSender(),
                address(0),
                _price,
                convertPaymentString(payment),
                0,
                true,
                title,
                category,
                description,
                hashtags
            );
            // add the token id and it's token info to all info mapping
            allNFTUnits[tokenCounter] = newToken;
            // increment counter
            tokenCounter++;
        }
        // make passed token URI as exists
        tokenURIExists[_tokenURI] = true;
        // make token name passed as exists
        tokenNameExists[_name] = true;

        emit MintNewToken(_msgSender(), _name, _tokenURI, numOfCopy, _price, payment);
    }

    // get total number of tokens minted so far
    function getNumberOfTokensMinted() public view returns (uint256) {
        return tokenCounter;
    }

    // check if the token already exists
    function getTokenExists(uint256 _tokenId) public view returns (bool) {
        bool tokenExists = _exists(_tokenId);
        return tokenExists;
    }

    // get URI of metadata of token
    function tokenURI(uint256 _tokenId)
        public
        view
        override
        returns (string memory)
    {
        require(
            _exists(_tokenId),
            "HyperXNFTCollection: token metadata URI query for nonexistent token"
        );

        return allNFTUnits[_tokenId].tokenURI;
    }

    // get name of token
    function tokenName(uint256 _tokenId) public view returns (string memory) {
        require(
            _exists(_tokenId),
            "HyperXNFTCollection: Token Name query for nonexistent token"
        );

        return allNFTUnits[_tokenId].tokenName;
    }

    // get previous owner of the token
    function tokenPreviousOwner(uint256 _tokenId)
        public
        view
        returns (address)
    {
        require(
            _exists(_tokenId),
            "HyperXNFTCollection: query of token previous owner for nonexistent token"
        );

        return allNFTUnits[_tokenId].previousOwner;
    }

    // get price of the token
    function tokenPrice(uint256 _tokenId) public view returns (uint256) {
        require(
            _exists(_tokenId),
            "HyperXNFTCollection: Token price query for nonexistent token"
        );

        return allNFTUnits[_tokenId].price;
    }

    function tokenPaymentType(uint256 _tokenId) public view returns (uint256) {
        require(
            _exists(_tokenId),
            "HyperXNFTCollection: Token payment type query for nonexistent token"
        );

        HyperXPaymentType p = allNFTUnits[_tokenId].payout;
        if (p == HyperXPaymentType.HyperXToken) return 0;
        else if (p == HyperXPaymentType.BNB) return 1;
        else if (p == HyperXPaymentType.BUSD) return 2;

        return 0;
    }

    function tokenTransferCount(uint256 _tokenId)
        public
        view
        returns (uint256)
    {
        require(
            _exists(_tokenId),
            "HyperXNFTCollection: Token transfer count query for nonexistent token"
        );

        return allNFTUnits[_tokenId].numberOfTransfers;
    }

    function tokenOnSale(uint256 _tokenId) public view returns (bool) {
        require(
            _exists(_tokenId),
            "HyperXNFTCollection: Token sale query for nonexistent token"
        );

        return allNFTUnits[_tokenId].forSale;
    }

    function tokenTitle(uint256 _tokenId) public view returns (string memory) {
        require(_exists(_tokenId));

        return allNFTUnits[_tokenId].title;
    }

    function tokenCategory(uint256 _tokenId) public view returns (string memory) {
        require(_exists(_tokenId));

        return allNFTUnits[_tokenId].category;
    }

    function tokenDescription(uint256 _tokenId) public view returns (string memory) {
        require(_exists(_tokenId));

        return allNFTUnits[_tokenId].description;
    }

    function tokenHashTags(uint256 _tokenId) public view returns (string memory) {
        require(_exists(_tokenId));

        return allNFTUnits[_tokenId].hashtags;
    }

    // by a token by passing in the token's id
    function buyNFT(uint256 _tokenId) public payable nonReentrant {
        // check if the function caller is not an zero account address
        require(_msgSender() != address(0), "null address");
        // check if the token id of the token being bought exists or not
        require(_exists(_tokenId), "non-existent token");
        // get the token's owner
        address tokenOwner = ownerOf(_tokenId);
        // token's owner should not be an zero address account
        require(tokenOwner != address(0), "owner is null");
        // the one who wants to buy the token should not be the token's owner
        require(tokenOwner != _msgSender(), "buyer should not be owner");
        // get that token from all info and create a memory of it defined as (struct => HyperXUnit)
        HyperXUnit memory tokenItem = allNFTUnits[_tokenId];
        // price sent in to buy should be equal to or more than the token's price
        require(msg.value >= tokenItem.price, "insufficient money to buy");
        // token should be for sale
        require(tokenItem.forSale, "token not on sale");
        // transfer the token from owner to the caller of the function (buyer)
        _transfer(tokenOwner, _msgSender(), _tokenId);
        // send token's worth of ethers to the owner
        payable(tokenOwner).transfer(msg.value);
        // update the token's previous owner
        tokenItem.previousOwner = tokenOwner;
        // update the how many times this token was transfered
        tokenItem.numberOfTransfers += 1;
        // set and update that token in the mapping
        allNFTUnits[_tokenId] = tokenItem;

        emit BuyToken(tokenOwner, _tokenId);
    }

    function changeNFTPrice(uint256 _tokenId, uint256 _newPrice)
        public
        nonReentrant
    {
        // require caller of the function is not an empty address
        require(_msgSender() != address(0), "null address");
        // require that token should exist
        require(_exists(_tokenId), "token must exist");
        // get the token's owner
        address tokenOwner = ownerOf(_tokenId);
        // check that token's owner should be equal to the caller of the function
        require(tokenOwner == _msgSender(), "No owner can not change token price");
        // get that token from all info mapping and create a memory of it defined as (struct => HyperXUnit)
        HyperXUnit memory tokenItem = allNFTUnits[_tokenId];
        // update token's price with new price
        uint256 oldPrice = tokenItem.price;
        tokenItem.price = _newPrice;
        // set and update that token in the mapping
        allNFTUnits[_tokenId] = tokenItem;

        emit ChangedPrice(tokenOwner, _tokenId, oldPrice, _newPrice);
    }

    // switch between set for sale and set not for sale
    function toggleForSale(uint256 _tokenId) public nonReentrant {
        // require caller of the function is not an empty address
        require(_msgSender() != address(0), "null address");
        // require that token should exist
        require(_exists(_tokenId), "token must exist");
        // get the token's owner
        address tokenOwner = ownerOf(_tokenId);
        // check that token's owner should be equal to the caller of the function
        require(tokenOwner == _msgSender(), "No owner can not change token price");
        // get that token from all info mapping and create a memory of it defined as (struct => HyperXUnit)
        HyperXUnit memory tokenItem = allNFTUnits[_tokenId];
        // if token's forSale is false make it true and vice versa
        if (tokenItem.forSale) {
            tokenItem.forSale = false;
        } else {
            tokenItem.forSale = true;
        }
        // set and update that token in the mapping
        allNFTUnits[_tokenId] = tokenItem;

        emit ToggleOnSale(tokenOwner, _tokenId, tokenItem.forSale);
    }

    function transferFrom(
        address from,
        address to,
        uint256 tokenId
    ) public virtual override {}

    function safeTransferFrom(
        address from,
        address to,
        uint256 tokenId
    ) public virtual override {}

    function safeTransferFrom(
        address from,
        address to,
        uint256 tokenId,
        bytes memory _data
    ) public virtual override {}
}

